      {"c394c9fb-f6ef-4ffa-920f-8dbd8998d95a":{"version":"3.2.1","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p2454","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p2445","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p2444","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 154.24 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 4095 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 3d 6hr &lt;/li&gt;\n&lt;li&gt; transfer time: 11.42 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.14.5.15:46319 &lt;/li&gt;\n          &lt;li&gt; Workers: 2048 &lt;/li&gt;\n          &lt;li&gt; Threads: 2048 &lt;/li&gt;\n          &lt;li&gt; Memory: 7.46 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2023.7.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2023.7.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    \n    args = setup_arg_parser()\n\n    # Create the connection to the remote Slurm managed cluster\n    connection = create_connection(args)\n\n\n    scheduler_address = connection.scheduler.address\n    print(\"Dashboard Link: \",connection.dashboard_link)\n    print(f\"Dask Scheduler Address: {scheduler_address}\")\n    write_txt('endpoints.txt',connection.dashboard_link+'\\n','w')\n\n    # Get the worker information, including CPU metrics\n    workers_info = connection.scheduler_info()[\"workers\"]\n\n    while len(workers_info) &lt; (args.cores * args.Nodes) :\n        workers_info = connection.scheduler_info()[\"workers\"]\n        print(f\"Waiting for {args.cores * args.Nodes} workers...\")\n        time.sleep(5)\n    \n    target_endpoints = [f\"localhost:{DaskDashboardPort}\"]\n\n    unique_addresses = set()  # Use a set to store unique addresses\n\n    for worker, info in workers_info.items():\n        port = info[\"services\"][\"dashboard\"]\n        address = worker.split(\"//\")[1].split(\":\")[0]\n        target_endpoints.append(f\"{address}:{port}\")\n        # Check if the address is already in the set, and only add it if it's not\n        if address not in unique_addresses:\n                target_endpoints.append(f\"{address}:9100\")\n                target_endpoints.append(f\"{address}:8080\")\n                # Add the address to the set to track it as a unique entry\n                unique_addresses.add(address)\n\n    print(target_endpoints)\n    write_txt('endpoints.txt','\\n'.join(target_endpoints),'a')\n\n    subprocess.run(['chmod', '+x', CREATE_SCREEN_COMMAND])\n    subprocess.run(CREATE_SCREEN_COMMAND, shell=True, check=True)\n\n    update_prometheus_config(target_endpoints)\n\n    subprocess.run(['chmod', '+x', EXEC_SCRIPT_PATH])\n    subprocess.run([EXEC_SCRIPT_PATH], shell=True, check=True)\n\n    npartitions_per_core = 1\n    ncores_total = args.cores * args.Nodes\n    npartitions = ncores_total * npartitions_per_core\n    nfiles = args.nfiles # 500\n    ntests = args.ntests # 3\n    \n    dataset = createDataset(nfiles)\n    #files = [ os.path.join('root://eospublic.cern.ch//eos/opendata/cms/derived-data/AOD2NanoAODOutreachTool/', data_file) for data_file in dataset ]\n    \n    files = [ os.path.join(LOCAL_DIRECTORY, data_file) for data_file in dataset ]\n\n    for _ in range(ntests):\n        with performance_report(filename=\"dask-report.html\"):\n            run(files, npartitions, connection, args)\n\n    connection.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p2449","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p2097","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p2095","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p2096","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p2107"},"y_scale":{"type":"object","name":"LinearScale","id":"p2108"},"title":{"type":"object","name":"Title","id":"p2100","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p2137","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p2092","attributes":{"selected":{"type":"object","name":"Selection","id":"p2093","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p2094"},"data":{"type":"map","entries":[["start",[1692647489117.3152,1692647489025.991,1692647489238.5508,1692647489098.1445,1692647489217.9268,1692647489109.197,1692647489134.0793,1692647489152.92,1692647489155.8198,1692647489148.431,1692647489190.4478,1692647489189.2544,1692647489204.6082,1692647489207.2434,1692647489220.3225,1692647489202.59,1692647489243.3738,1692647489244.636,1692647489434.5217,1692647489268.076,1692647489268.7603,1692647489262.6257,1692647489280.1458,1692647489257.4524,1692647489387.731,1692647489333.6548,1692647489472.1096,1692647489499.411,1692647489514.6157,1692647489515.1106,1692647489330.7107,1692647489341.7676,1692647489536.5947,1692647489348.954,1692647489547.3127,1692647489368.2043,1692647489554.525,1692647489594.8696,1692647489398.8157,1692647489382.154,1692647489353.8474,1692647489571.732,1692647489355.3347,1692647489559.8225,1692647489569.7278,1692647489366.5928,1692647489564.2778,1692647489578.0913,16926474
